    [],nt"revision_timestamp": "2016-08-20T09:39:35.161405",nt"name": "nisqually-early-detection-rapid-response-monitoring-and-mapping-of-high-priority-invasives",nt"isopen":
    false,nt"url": null,nt"notes": "This project plan was to initiate a program
    for early detection and response, monitoring and mapping of invasive species on
    Grays Harbor NWR and continued current efforts on Nisqually NWR by Refuge Weed Warriors.
    Efforts are to focus on detecting, treating, and monitoring new infestations of
    highest priority invasive plants. Several priority species pose a substantial threat
    and require an early detection rapid response program to preclude new infestations
    from becoming established. These include Spartina on and around Grays Harbor NWR
    and wild chervil and purple loosestrife on the Black River Unit of Nisqually. Monitoring
    and mapping of more established and widespread weeds such as Phragmites, Japanese
    knotweed, and tansy ragwort would also be of benefit. The program hinged on getting
    anSCA intern to coordinate the large volunteer effort to detect, map and monitor
    invasives utilizing existing Refuge GPS and GIS capabilities to collect data and
    maintain databases and maps.",nt"license_title": "License Not Specified",nt"extras":
